import React, { Component } from 'react'
import axios from 'axios';

class PostList extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              posts:[],
              error:""
         }
     }
     
     componentDidMount(){
         axios.get('https://jsonplaceholder.typicode.com/posts')
         .then(Response=>{
             this.setState({
                 posts:Response.data
             })
         })
         .catch(error=>{
             this.setState({
                 error: error.data
             })
         })
     }

    render() {
        const {posts,error}=this.state
        return (
            <div>
               <h1> list of posts</h1>
                {
                    posts.length?
                    posts.map(post => <div key={post.id}><li>{post.title}</li></div>):
                <div>{error}</div>
                }
            </div>
        )
    }
}

export default PostList
